            </div>
            <small>Copyright 2021 Mintz Global Screening. All rights reserved. <br />
            Designated trademarks and brands are the property of their respective owners.</small>
          </div>
          <div className="col-sm-6 right">test</div>
        </div>
      </div>
    </>
  );
}

export default App;
